const outerBox = {
  marginTop: 8,
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
};

const loginIcon = { m: 1, bgcolor: "primary.main" };

// eslint-disable-next-line import/no-anonymous-default-export
export default { outerBox, loginIcon };
